Lift a curse and save the Cypress Witch in Spirit Walkers: Curse of the Cypress Witch! Maylynn and a group of friends go on what was supposed to be an innocent hiking trip when one of her friends gets seriously hurt. Looking for help Maylynn ends up at a beautiful and majestic cypress tree. She meets a witch that offers to help in exchange for a favor first. Now you'll have to travel to a different time and dimension to undo a thing that once went wrong!

Experience the etheric dimension
Shift between realms to complete quests
Lift the curse and save the Witch!

THANKS TO VELOCITY

